Here is a simple C++ function to calculate the area of a cube:

```cpp'
#include<iostream>
using namespace std;

double calculateCubeArea(double side) {
    // The formula for calculating the surface area of a cube is 6 * side^2.
    return 6 * (side * side);
}

int main() {
    double side;

    cout << "Enter the side length of the cube: ";
    cin >> side;

    double area = calculateCubeArea(side);

    cout << "The area of the cube is: " << area << endl;

    return 0;
}
```

In this program, we first include the necessary headers and use the `std` namespace for input/output operations. We then define a function called `calculateCubeArea` that takes a single parameter `side`, which represents the length of one side of the cube.

Inside the function, we calculate the area using the formula `6 * side^2`, where `side` is the length of one side of the cube. The result is returned from the function.

