In Rust, to print formatted strings with variables, to use `println!` macro, you need to specify the arguments using `{}` placeholders and separate them from the format string with commas. Here's how you can do it:

```rust 
let name = "John";
let age = 30;
println!("Hello, {}! You are {} years old.", name, age);
```

This will print: `Hello, John! You are 30 years old.` 

Alternatively, if you're using Rust 1.58 or later, you can use named arguments for better readability:

```rust 
let name = "John";
let age = 30;
println!("Hello, {name}! You are {age} years old.");
```

This will also print: `Hello, John! You are 30 years old.`assistant

