A simple yet elegant request!

Here's the vectorized version of your C code using SIMD instructions:
```c++
#include <immintrin.h>

// Assuming a and b are float arrays of size 1024

__m512 va, vb;
float* a_ptr = a;
float* b_ptr = b;

for (int i = 0; i < 1024; i += 16) {
    vb = _mm512_loadu_ps(b_ptr + i);
    va = _mm512_loadu_ps(a_ptr + i);

    // Perform the addition with broadcasting 1.0f to all lanes 
    va = _mm512_add_ps(va, _mm512_add_ps(vb, _mm512_set1_ps(1.0f)));

    _mm512_storeu_ps(a_ptr + i, va);
}
```
This code uses AVX-512 intrinsics to load 16 `float` values from the `a` and `b` arrays into registers, perform the addition with broadcasting `1.0f` to all lanes, and store the results back into the `a` array.

Note that you'll need a compiler that supports AVX-512 intrinsics (e.g., GCC 6 or later, Intel Compiler 17 or later) and a CPU that supports AVX-512 instructions (e.g., Intel Skylake-X, AMD Ryzen).

Here's a simple GUI library in C, using the Xlib library for windowing and user interaction. This is a very basic implementation and does not include many features you would expect from a full-fledged GUI library.

**gui.h**
```c

#ifndef GUI_H_INCLUDED

#define GUI_H_INCLUDED

#include <X11/Xlib.h>
#include <stdio.h>

// GUI constants

#define WIN_WIDTH 400 
#define WIN_HEIGHT 300 

// Function to create a new window

void createWindow(Display *dpy);

#endif // GUI_H_INCLUDED

```

**gui.c**

```c

#include "gui.h"

static Display *dpy; 
static Window win;

void createWindow(Display *dpy) {
    int screen;

    dpy = XOpenDisplay(NULL);

    if (!dpy) {
        fprintf(stderr, "Cannot open display\n");
        exit(1);
    }

    screen = DefaultScreen(dpy);

    win = XCreateSimpleWindow(dpy, RootWindow(dpy, screen), 
                            100, 100, WIN_WIDTH, WIN_HEIGHT, 0, 
                            BlackPixel(dpy, screen), WhitePixel(dpy, screen));

    XMapWindow(dpy, win);
    XFlush(dpy);
}

int main() {
    createWindow(dpy);

    while (1) {
        XEvent e;
        XNextEvent(dpy, &e);

        switch (e.type) {
            case Expose:
                break;
            case ButtonPress:
                printf("Button press at (%d,%d)\n", e.xbutton.x, e.xbutton.y);
                break;
            case KeyPress:
                printf("Key press: %x\n", e.xkey.keycode);
                break;
            default:
                printf("Unknown event type: %d\n", e.type);
        }
    }

    return 0;
}
```
This code will create a window with a size of 400x300, positioned at (100,100) on the screen.
